def get_fund_list(url, page):
    main_form_data = {
        '__EVENTTARGET': 'ctl00$cphMain$AspNetPager1',
        '__EVENTARGUMENT': page,
        '__LASTFOCUS': '',
        '__VIEWSTATE': '',
        '__VIEWSTATEGENERATOR': '302D9840',
        '__EVENTVALIDATION': '',
        'ctl00$cphMain$ddlCompany': '',
        'ctl00$cphMain$ddlPortfolio': '',
        'ctl00$cphMain$ddlWatchList': '',
        'ctl00$cphMain$txtFund': '基金名称',
        'ctl00$cphMain$ddlPageSite': '25'
    }
    req_data = requests.post(url, headers=header, data=main_form_data, timeout=10)
    return etree.HTML(req_data.text)


